const nav = document.querySelector('.navbar');
fetch('/page/header.html')
  .then(res => res.text())
  .then(data => {
    nav.innerHTML = data;
  })
 
const footer = document.querySelector('.footer');
fetch('/page/footer.html')
  .then(res => res.text())
  .then(data => {
    footer.innerHTML = data;
  })
